import React from "react";
import { Chart } from "react-google-charts";

//------- Import-componentes---------------------///
import Header from './componentes/Header'
import Main from'./componentes/Main'

//-----------css--------------------------
import './css/main.scss'

//-----------------------------------------------------

const App = () => {




 return(
    <div className="App">
        <Header/>
        <Main/>
        <Chart
  chartType="ScatterChart"
  data={[["Age", "Weight"], [4, 5.5], [8, 12]]}
  width="100%"
  height="400px"
  legendToggle
/>

    </div>
 );


}
export default App;
